import '../blocks/button/button.css';
import iconDel from '../images/icons8-delete.svg';

export default function Button({content='add', handleClick, type}) {

  const style = (type === 'image') ? 'button button_image' : 'button button_text';

  const x =(type === 'image') ? <img src={iconDel} alt=''></img> : {content};

  let onClick = (e) => {
    e.preventDefault();
    handleClick();
  }

  return (
    <button 
      className={style}
      onClick={onClick}
    >
      {x}
    </button>
  )
}
